import React, { Component } from 'react';
import './DashBoard.css';
import menu from './assest/menuIcon.svg'
import search from './assest/search.svg'
import refresh from './assest/refresh.svg'
import list from './assest/list.svg'
import settings from './assest/settings.svg'
import account from './assest/account.svg'
import { Input } from '@material-ui/core';
import Tooltip from '@material-ui/core/Tooltip';
// import Avatar from '@material-ui/core/Avatar';
import Avatar from 'react-avatar';


class DashBoard extends Component {
  render() {
    return (
      <div className ="DashBoard"> 

      <div style={{width :'15%'}}>
      <Tooltip title="Main Menu">
      <img src={menu} className="logo" alt="logo" onClick = {() =>{console.log('menu clicked')}} />
      </Tooltip>

       <div className="text">
       Fundoo Notes
       </div>
       </div>

       <div className ="searchNote">
       <Tooltip title="Search">
       <img src={search} className="logo" alt="logo" />
       </Tooltip>
                search your note
       </div>

       <div style = {{width : '18%',backgroundColor :'red'}}>
        <Tooltip title = "Refresh">
        <img src={refresh} className="logo" alt="logo" />
        </Tooltip>

       <Tooltip title = "List View">
       <img src={list} className="logo" alt="logo" />
       </Tooltip>

       <Tooltip title = "Settings">
       <img src={settings} className="logo" alt="logo" />
       </Tooltip>

       <Tooltip title = "Fundoo Account">
       {/* <img src={account} className="logo" alt="logo" /> */}
       {/* <Avatar>H</Avatar> */}
       <Avatar name="Foo Bar" />
       </Tooltip>

       </div>

      </div>
    );
  }
}

export default DashBoard;
